class Problem {
    // Find the shortest palindrome that begins with a supplied string.
    // Algorithm idea is simple:
    // - Find the longest postfix of supplied string that is a palindrome.
    // - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
    // >>> makePalindrome((""))
    // ("")
    // >>> makePalindrome(("cat"))
    // ("catac")
    // >>> makePalindrome(("cata"))
    // ("catac")
    public static String makePalindrome(String string) {
        int n = string.length();
        if (n == 0) {
            return "";
        }
        int[] prefixFunction = new int[n];
        prefixFunction[0] = 0;
        for (int i = 1; i < n; i++) {
            int j = prefixFunction[i - 1];
            while (j > 0 && string.charAt(i) != string.charAt(j)) {
                j = prefixFunction[j - 1];
            }
            if (string.charAt(i) == string.charAt(j)) {
                j++;
            }
            prefixFunction[i] = j;
        }
        int palindromeEnd = prefixFunction[n - 1];
        String palindromePrefix = string.substring(0, palindromeEnd);
        String palindromeSuffix = new StringBuilder(palindromePrefix).reverse().toString();
        return string + palindromeSuffix;

