    public static ArrayList<Long> parseMusic(String music_string) {
        ArrayList<Long> beats = new ArrayList<Long>();
        String[] notes = music_string.split(" ");
        for (String note : notes) {
            if (note.equals("o")) {
                beats.add(4l);
            } else if (note.equals("o|")) {
                beats.add(2l);
            } else if (note.equals(".|")) {
                beats.add(1l);
            }
        }
        return beats;

